import React from "react";

const SubjectText = () =>{
    return (
        <div className={"subject-text"}>
            <div className={"text-wrapper"}>
                <h3>Lich</h3>
                <p>
                    A lich often haunts the abode it favored in life, such as a lonely tower,
                    a haunted ruin, or an academy of black magic. Alternatively, some liches
                    construct secret tombs filled with powerful guardians and traps.
                </p>
            </div>
        </div>
    )
};

export default SubjectText;
